I've had the need to overload the get and post methods from the Application interface in order to pass an array of handlers. To call like this:

get(path,[handler1,handler2,handler3])

instead of 

get(path,handler1,handler2,handler3)

The Javascript code is capable of doing this however, the definition doesn't allow it.

I created an external complementary definition to post as follows:

declare module "express"
{
    module e
    {
        interface IRouterMatcher<T>
        {
            (name: string, preHandlers: RequestHandler[], ...handlers: RequestHandler[]): T;
        }
    }
}

However, the way get is defined prevents me from doing the same with get. 

I've changed it so that this is allowed simply by defining n interface IApplicationGetter that extends  IRouterMatcher<T> and adds the app.get method (environment variable).

This change doesn't break anything and it makes it more consistent.

See https://fetch.spec.whatwg.org/#concept-request-credentials-mode. Credentials mode is one of "omit", "same-origin", and "include". Credentials property is a _string_ type.
Enums in whatwg-fetch.d.ts:

``` typescript
declare enum RequestCredentials { "omit", "same-origin", "include" }
```

Unfortunately, TypeScript (1.5, 1.6 beta) hasn't supported strings enum yet. Every enum in fact is a _number_. So I can compile this, but it's wrong:

``` typescript
window.fetch('/url', {
  credentials: 0
});
```

Cannot compile this, but it's correct:

``` typescript
window.fetch('/url', {
  credentials: 'same-origin'
});
// tsc error
// Type 'string' is not assignable to type 'RequestCredentials'
```

Finally:

``` typescript
window.fetch('/url', {
  credentials: RequestCredentials['same-origin']
});
```

Compiled to the same code of javascript (word by word) and TS don't provide any prefilling    RequstCredentils object in run time:

``` javascript
window.fetch('/url', {
  credentials: RequestCredentials['same-origin']
});
// browser error
// Uncaught ReferenceError: RequestCredentials is not defined
```

